class MySwitch(QPushButton):
    def __init__(self, parent = None):
        super().__init__(parent)
        print('init')
        self.setCheckable(True)
        self.setMinimumWidth(100)
        self.setMinimumHeight(22)
        
    def paintEvent(self, event):
        label = "ON" if self.isChecked() else "OFF"
        bg_color = QColor.fromRgb(3,155,229) if self.isChecked() else QColor.fromRgb(50,50,50)
        #label.setStyleSheet("color:black;") if self.isChecked() else label.setStyleSheet("color:white;")
        
        radius = 11
        width = 50
        center = self.rect().center()

        painter = QPainter(self)
        painter.setRenderHint(QPainter.Antialiasing)
        painter.translate(center)
        painter.setBrush(QColor(0,0,0))

        pen = QPen(QColor.fromRgb(225,225,225))
        pen.setWidth(2)
        painter.setPen(pen)

        painter.drawRoundedRect(QRect(-width, -radius, 2*width, 2*radius), radius, radius)
        painter.setBrush(QBrush(bg_color))
        sw_rect = QRect(-radius, -radius, width + radius, 2*radius)
        if not self.isChecked():
            sw_rect.moveLeft(-width)
        painter.drawRoundedRect(sw_rect, radius, radius)
        painter.drawText(sw_rect, Qt.AlignCenter, label)





